import React, { Component } from 'react'
import logo from "../../assets/images/logo.png";
import shoppingCart from "../../assets/images/shopping-cart.png";
import { Link } from 'react-router-dom';
export default class Header extends Component {
    render() {

        const { categories } = this.props;
        const categoryName = this.props.match?.params?.categoryName; // Get active category from URL

        return (
            <header>
                <nav className="navbar navbar-expand-lg ">
                    <div className="container">


                        <div className="collapse navbar-collapse d-flex justify-content-between" id="navbarNav">




                            <ul className="navbar-nav d-flex align-items-center">

                                {categories.map((category) => (<li key={category}
                                    className={categoryName === category ? 'active' : ''}>

                                    <Link to={`/category/${category}`} className="nav-link active">
                                        {category}
                                    </Link>
                                </li>))}
                            </ul>

                            <span>
                                <a className="navbar-brand" href="#">
                                    <img src={logo} alt='logo' />


                                </a>

                            </span>
                            <div className='shoppingCart'><button className='btn'>
                                <img src={shoppingCart} alt='shopping cart' className='' />

                            </button></div>

                        </div>

                    </div>
                </nav>


            </header>
        )
    }
}
